import React, { Component } from 'react';
import Toolbar from '../../components/Navigation/Toolbar/Toolbar';
import Video from '../../components/Video/Video';
import vidSrc from '../../assets/enter-sandman.mp4';
import soundSrc from '../../assets/sound.png';
class layout extends Component {

    state = {
        links: [
            { name: 'Home', value: '/' },
            { name: 'Jampads', value: '/jam-pads' },
            { name: 'Bookings', value: '/bookings' }
        ]
    }

    dropClickHandler = (event, inputIdentifier) => {
        //this.props.history.push(url);
        console.log(event.target.value);
        window.location.href = event.target.value;
        // this.context.history.push('/path');
    }

    soundClickHandler = (event) => {
        console.log('clicked!');
    }

    render() {
        return (
            <React.Fragment>
                <Toolbar click={(event) => this.dropClickHandler(event)}
                    links={this.state.links}
                />
                {/* <Video src='../../assets/enter-sandman.mp4' /> */}

                {/* <Video/> */}
                    <Video click={this.soundClickHandler} src={vidSrc} sound={soundSrc}/>
            </React.Fragment>
        );
    }

}

export default layout;
